import React from "react";
import HomeScreen from "../components/HomeScreen";
import { motion } from "framer-motion/dist/framer-motion";

const Home = () => {
  return (
    <motion.div
      initial = {{width: 0}}
      animate = {{width: "100%"}}
      exit = {{x: window.innerWidth, transition: {duration: 10}}}>
      <HomeScreen/>
    </motion.div>);
}

export default Home
